import {Navbar, Container, Row, Col} from "react-bootstrap";
import Image from 'react-bootstrap/Image'


//will be imported in the _app component for all pages
//color: 64AB8A
//needs to be made sticky

const navbar = {backgroundColor: "#64AB8A"}
class Footer extends React.Component {
  render() {
    return (
      <MDBFooter color="blue" className="font-small pt-4 mt-4">
        <MDBContainer fluid className="text-center text-md-left">
          <MDBRow>
            <MDBCol md="6">
              <h5 className="title">Footer Content</h5>
              <p>
                Here you can use rows and columns here to organize your footer
                content.
              </p>
            </MDBCol>
            <MDBCol md="6">
              <h5 className="title">Links</h5>
              <ul>
                <li className="list-unstyled">
                  <a href="#!">Link 1</a>
                </li>
                <li className="list-unstyled">
                  <a href="#!">Link 2</a>
                </li>
                <li className="list-unstyled">
                  <a href="#!">Link 3</a>
                </li>
                <li className="list-unstyled">
                  <a href="#!">Link 4</a>
                </li>
              </ul>
            </MDBCol>
          </MDBRow>
        </MDBContainer>
        <div className="footer-copyright text-center py-3">
          <MDBContainer fluid>
            &copy; {new Date().getFullYear()} Copyright: <a href="https://www.mdbootstrap.com"> MDBootstrap.com </a>
          </MDBContainer>
        </div>
      </MDBFooter>
    );

  //   return(
  //     <div className="fixed-bottom">  
  //     <Navbar style={navbar}>
  //         <Container>
  //           <Col>
  //             <div style={{display: 'flex', justifyContent: 'center'}}>
  //               <div>
  //                 <Image src="./images/github.png" width = "30" height = "30"/>
  //                 <Image src="./images/fb.png" width = "30" height = "30"/>
  //                 <Image src="./images/insta.png" width = "30" height = "30"/>
  //               </div>
  //             </div>
  //             <div style={{display: 'flex', justifyContent: 'center'}}>
  //               <div>
  //                 <Image src="./images/H4I_green.png" width = "205" height = "70"/>
  //               </div>
  //             </div>
  //           </Col>

  //         </Container>
  //     </Navbar>
  //     </div>
  // )
  }
}

export default Footer;
